Video.create!([
                  { link: nil, title: "Lasagne på fredag? Morten Ramm og Steffan Ludvigsen", published_at: "2014-11-24 16:36:23", likes: 1, dislikes: 0, uid: "se35hi53ais", thumbnail_url: "https://i.ytimg.com/vi/se35hi53ais/mqdefault.jpg", views: 167, description: "Den første sendingen i Morten og Steffan`s videopodcast gjør fort unna selve åpningen og det høytidelige rundt det.  Så går gutta nærmere inn på en viktig tema, nemlig planleggingen av middagene på den forestående hytteturen.  \n\nEpisode 01, sesong 1.\n\nMorten og Steffans videopodcasat ble lansert på Facebook høsten 2014 og vokste gradvis.   Nærmere jul fikk videopodcasten også som rimelig kan være en egen YouTube-kanal. Abonnerer du?", tags: nil, channel_title: "Morten og Steffan`s videopodcast", views_last_week: 3, category_id: 9, channel_id: "UCB7R3D6P4HDG4b2YMb6teMA" },
                  { link: nil, title: "På hytta? Hvilken hytte da? Morten Ramm og Steffan Ludvigsen", published_at: "2014-11-24 16:30:36", likes: 0, dislikes: 0, uid: "1v6QDgAB4Cg", thumbnail_url: "https://i.ytimg.com/vi/1v6QDgAB4Cg/mqdefault.jpg", views: 36, description: "Når vi sier at vi skal på hytta, hva ligger egentlig i det?  Morten Ramm og Steffan Ludvigsen snakker grundig om dette i denne utgaven av Morten og Steffans videopodcast.\n\nEpisode 02, sesong 1.\n\nMorten og Steffans videopodcasat ble lansert på Facebook høsten 2014 og vokste gradvis.   Nærmere jul fikk videopodcasten også som rimelig kan være en egen YouTube-kanal!  Abonnerer du?", tags: nil, channel_title: "Morten og Steffan`s videopodcast", views_last_week: 1, category_id: 9, channel_id: "UCB7R3D6P4HDG4b2YMb6teMA" },
                  { link: nil, title: "Full pedal i ny uke!  Morten Ramm og Steffan Ludvigsen", published_at: "2014-11-24 16:23:21", likes: 0, dislikes: 0, uid: "hev05z2FGv4", thumbnail_url: "https://i.ytimg.com/vi/hev05z2FGv4/mqdefault.jpg", views: 49, description: "Ny uke, nye muligheter heter det så fint.  Hvilke muligheter da?  De på jobben?  De hjemme?  I denne utganven av Morten og Steffans videopodcast drøfter de dette med tingene vi må ta tak i og hvordan det er når ny uke kommer.\n\n\nEpisode 03, sesong 1.\n\nMorten og Steffans videopodcasat ble lansert på Facebook høsten 2014 og vokste gradvis.   Nærmere jul fikk videopodcasten også som rimelig kan være en egen YouTube-kanal.", tags: nil, channel_title: "Morten og Steffan`s videopodcast", views_last_week: 0, category_id: 9, channel_id: "UCB7R3D6P4HDG4b2YMb6teMA" },
                  { link: nil, title: "Hvor ofte bør man podcaste?  Morten Ramm og Steffan Ludvigsen", published_at: "2014-11-24 15:58:32", likes: 0, dislikes: 0, uid: "rFz_33-W3dA", thumbnail_url: "https://i.ytimg.com/vi/rFz_33-W3dA/mqdefault.jpg", views: 31, description: "Kontakt med publikum er nokså viktig i media.  I denne podcasten drøfter Morten og Steffan hvor ofte det er nødvendig å poste?  Morten understreker at det er viktig at folk prater om det.\n\nEpisode 5 i sesong 1 av Morten og Steffans videopodcast", tags: nil, channel_title: "Morten og Steffan`s videopodcast", views_last_week: 0, category_id: 8, channel_id: "UCB7R3D6P4HDG4b2YMb6teMA" },
                  { link: nil, title: "Du får mer likes enn meg!  Morten Ramm og Steffan Ludvigsen", published_at: "2014-11-24 15:41:14", likes: 0, dislikes: 0, uid: "Kf-_fstqpVU", thumbnail_url: "https://i.ytimg.com/vi/Kf-_fstqpVU/mqdefault.jpg", views: 51, description: "Spennende utvikling for videopodcasten!  Mye å tenkte på!  I business er det mye å være usikker på, og Steffan er usikker på hele YouTube-greia.  Men noen ganger kommer det gode svar fra uventet hold!\n\nEpisode 5, sesong 1 av Morten og Steffans videopodcast!", tags: nil, channel_title: "Morten og Steffan`s videopodcast", views_last_week: 0, category_id: 8, channel_id: "UCB7R3D6P4HDG4b2YMb6teMA" },
                  { link: nil, title: "Kjenner du Bård?  Morten Ramm og Steffan Ludvigsen", published_at: "2014-11-24 15:32:44", likes: 1, dislikes: 0, uid: "E37n_dmq4AM", thumbnail_url: "https://i.ytimg.com/vi/E37n_dmq4AM/mqdefault.jpg", views: 52, description: "Kjenner du også Bård Flugsrud?  Er du blitt bedt?  I Morten og Steffans videopodcast drøfter de små, men viktige ting i arbeidslivet.\n\nDette er episode 6 i sesong 1.", tags: nil, channel_title: "Morten og Steffan`s videopodcast", views_last_week: 1, category_id: 8, channel_id: "UCB7R3D6P4HDG4b2YMb6teMA" },
                  { link: nil, title: "Travle tider i media!  Morten Ramm og Steffan Ludvigsen", published_at: "2014-11-24 15:08:16", likes: 2, dislikes: 0, uid: "F7tNoWEys3o", thumbnail_url: "https://i.ytimg.com/vi/F7tNoWEys3o/mqdefault.jpg", views: 34, description: "Er det mas og jag i media?  Morten og Steffan utdyper dette temaet for de som lurer.  Mange tror at de som jobber i TV jobber mindre enn andre.  Men sannheten er at noen har dårlig tid.  Men hva er egnetlig dårlig tid?\n\nEpisode 8 i sesong 1 av Morten og Steffans videopodcast.", tags: nil, channel_title: "Morten og Steffan`s videopodcast", views_last_week: 0, category_id: 8, channel_id: "UCB7R3D6P4HDG4b2YMb6teMA" },
                  { link: nil, title: "Alltid hyggelig med gode tilbakemeldinger!  Morten Ramm og Steffan Ludvigsen", published_at: "2014-11-24 14:50:09", likes: 2, dislikes: 0, uid: "2Ymyt-aFoMY", thumbnail_url: "https://i.ytimg.com/vi/2Ymyt-aFoMY/mqdefault.jpg", views: 120, description: "Temaet i videopodcasten er at det alltid er hyggelig å få en klapp på skulderen!  Det føles godt når selv totalt ukjente folk kommer og gir ros!  Så moralen er:  Når gjorde du det sist?\n\nTusen takk for gode og konstruktive tilbakemeldinger!  Fortsett å kommenter, lik og del våre filmer!\n\nDette er siste episode av første sesong av Morten og Steffans videopodcast.  Snart kommer sesong 2!", tags: nil, channel_title: "Morten og Steffan`s videopodcast", views_last_week: 0, category_id: 8, channel_id: "UCB7R3D6P4HDG4b2YMb6teMA" },
